const Header = () => {
  return (
    <header className="bg-gradient-to-r from-emerald-500 to-blue-950 py-6 px-4 shadow-lg">
      <div className="max-w-5xl mx-auto flex justify-between items-center">
        {/* Contenedor para el logo de Kushki y el título IntelliPrompt */}
        <div className="flex items-center gap-4">
          {/* Logo de Kushki en la esquina superior izquierda */}
          {/* Si KUSHKI.png está directamente en la carpeta 'public/', la ruta debería ser así: */}
          <img src="KUSHKI.png" alt="Logo de Kushki" className="h-20" /> 
          <h1 className="text-2xl font-bold text-white">IntelliPrompt</h1>
        </div>

        {/* Texto de la descripción (se mantiene) */}
        <div className="text-white opacity-90">
          Crea un prompt y envíalo a la IA de tu preferencia
        </div>

        {/* Logo de IntelliPrompt en la esquina superior derecha */}
        {/* Si logoIntelliPrompt.png está directamente en la carpeta 'public/', la ruta debería ser así: */}
        <img src="logoIntelliPrompt.png" alt="Logo de IntelliPrompt" className="h-20" />
      </div>
    </header>
  );
};

export default Header;
